import {  View, Text} from 'react-native';

const AddQuantity = (cartItemNumber) => {
        cartItemNumber = 0;
        cartItemNumber++;
    return(
        <View>
            <Text>{cartItemNumber}</Text>
        </View>
    );

}

export default AddQuantity;
